TEDTalks : New eyes on the wonders of the ocean - Bill Lange / David Gallo (2008)

David Gallo and Bill Lange present amazing film of ocean life, captured with new high-def cameras and techniques. Look for corals, jellies and exquisite creatures of the seamounts, plus shipwrecks and whales and an eerie underwater lake.
